import React from "react";

class Navigation extends React.Component {
  render() {
    const NavStyle = {
      width: "100%",
      float: "left",
      margin: "0 0 3em 0",
      padding: "0",
      "list-style": "none",
    };
    return (
      <div>
        <ul style={NavStyle} id="homeNav">
          <li>
            <a href="/">Home</a>
          </li>
          <li>
            <a href="/contact">Contact</a>
          </li>
          <li>
            <a href="/about">About</a>
          </li>
          <li>
            <a href="/shop">Shop</a>
          </li>
          <li>
            <a href="/videos">Videos</a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Navigation;
